import React, { Component } from "react";
import Link from "next/link";
// import "../src/styles.scss";
import "../src/styles.css";

class Index extends React.Component {
  render() {
    return (
      <div>
        <h1>Index</h1>
        <Link href='/main'>
          <button className='btn'>Main</button>
        </Link>
      </div>
    );
  }
}

export default Index;
